import './ComingSoon.scss';

const ComingSoon = () => {
  return (
    <div className="comingSoon">

        <div className="info">
            <h1 className='milliondollar'>MillionDollarPosters</h1>
            <h1 className="subtext">Selling Soon!</h1>
        </div>
    </div>
  )
}

export default ComingSoon
